// these data are for the input value for the 
// message form in the contacts page
export const inputvalues = [
  {
    el: 'input',
    type: 'text',
    placeholder: 'Full name *',
    background: 'user.png',
    name: 'name',
  },
  {
    el: 'input',
    type: 'email',
    placeholder: 'Email address *',
    background: 'envelop.png',
    name: 'email',
  },
  {
    el: 'input',
    type: 'text',
    placeholder: `Subject: Just sayin' hi!`,
    background: 'title.png',
    name: 'hi',
  },
  {
    el: 'textarea',
    placeholder: 'Message *',
    name: 'message',
  },
]
